  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Erie National
  Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar year. The
  report begins with an introduction to the Refuge and information about weather conditions,
  habitat conditions, land acquisition activities, and the system status. Construction
  and maintenance are also described. Habitat management is covered; croplands, grasslands,
  wetlands, forests, and wilderness areas are discussed. The wildlife section of the
  report discusses migratory birds, mammals, and non-migratory birds. Interpretation
  and recreation activities are outlined; topics include fishing, hunting, and law
  enforcement. Field investigations, cooperative programs, items of interest, and
  safety information are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
